class GetEqualSubstringWithinBudget:
    def getEqualSubstringWithinBudget(self, s, t, maxCost):
        res, cnt = 0, 0
        cost = maxCost

        for i in range(len(s)):
            cost = maxCost
            cnt = 0
            for schar, tchar in zip(s[i:], t[i:]):
                diff = abs(ord(schar) - ord(tchar))
                if diff > cost:
                    break
                cost -= diff
                cnt += 1
            res = max(res, cnt)

        return res

    def getEqualSubstringWithinBudget_SW(self, s, t, maxCost):
        res, cnt = 0, 0

        i, j = 0, 0
        while j < len(s):
            cnt += abs(ord(s[j]) - ord(t[j]))
            if cnt > maxCost:
                res = max(res, j-i)
                while cnt > maxCost:
                    cnt -= abs(ord(s[i]) - ord(t[i]))
                    i += 1
            j += 1

        if j == len(s) and cnt <= maxCost:
            res = max(res, j - i)

        return res


